import React from 'react';
import {
  BrowserRouter,
  Router,
  Routes,
  Route
} from "react-router-dom";

import Home from './components/Home';

function App() {
  return (


    <Router>
    <Routes>
    <Route path="/" components={Home}></Route>
    </Routes>
   </Router>


  );
}

export default App;
